// import useStyles from './SidebarStyles';
import {List, ListItem, ListItemIcon, ListItemText, Paper, Typography} from '@material-ui/core'
import FolderIcon from '@material-ui/icons/Folder'
import { Link,NavLink } from 'react-router-dom';

const useStyles =  makeStyles((theme) => ({
    sidebar: {
        height: '100vh',
        [theme.breakpoints.down('sm')]: {
            width: '60%',
        },
    },
    mainTitle: {
        minHeight: '58px',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center'
    },
    active: {
        color: '#fcfcfc',
        backgroundColor: 'red',
    },
}));

const Sidebar = () => {

    const classes = useStyles();

    return (
        <Paper className={classes.sidebar}>
            <Typography variant="h5" className={classes.mainTitle}>Dashboard</Typography>
            <hr />
            <List component="ul" aria-label="main mailbox folders">

                <ListItem button >
                    <ListItemIcon>
                        <FolderIcon />
                    </ListItemIcon>
                    {/* <ListItemText primary="Client" /> */}
                    <NavLink to='/client' activeClassName="active">Client</NavLink>
                </ListItem>
                <ListItem button component={Link} to="/branch" >
                    <ListItemIcon>
                        <FolderIcon />
                    </ListItemIcon>
                    <ListItemText primary="Branch" />
                </ListItem>
                <ListItem button component={Link} to="/contact/person" >
                    <ListItemIcon>
                        <FolderIcon />
                    </ListItemIcon>
                    <ListItemText primary="Contact Person" />
                </ListItem>
                <ListItem button component={Link} to="/contract" >
                    <ListItemIcon>
                        <FolderIcon />
                    </ListItemIcon>
                    <ListItemText primary="Contract" />
                </ListItem>

            </List>
        </Paper>
    )
}

export default Sidebar
